@cached_property
def exceptions(self) -> list[Union[str, type[BaseException]]]:
    from ._extractors import get_name

    excs = []
    for expr in self.args:
        name = get_name(expr)
        if not name:
            continue
        exc = getattr(builtins, name, name)
        excs.append(exc)
    return excs
